<div class="container mt-4">
  <h2>{{ isEditMode ? 'Edit Trip' : 'Add Trip' }}</h2>

  <form (ngSubmit)="onSubmit()">
    <div class="form-group">
      <label>Trip Name:</label>
      <input type="text" class="form-control" [(ngModel)]="trip.tripName" name="tripName" required />
    </div>

    <div class="form-group">
      <label>Destination:</label>
      <input type="text" class="form-control" [(ngModel)]="trip.destination" name="destination" required />
    </div>

    <div class="form-group">
      <label>Start Date:</label>
      <input type="date" class="form-control" [(ngModel)]="trip.startDate" name="startDate" required />
    </div>

    <div class="form-group">
      <label>End Date:</label>
      <input type="date" class="form-control" [(ngModel)]="trip.endDate" name="endDate" required />
    </div>

    <div class="form-group">
      <label>Budget (in ₹):</label>
      <input type="number" class="form-control" [(ngModel)]="trip.budget" name="budget" />
    </div>

    <div class="form-group">
      <label>Transportation Type:</label>
      <select class="form-control" [(ngModel)]="trip.transportation" name="transportation">
        <option value="Flight">Flight</option>
        <option value="Train">Train</option>
        <option value="Bus">Bus</option>
        <option value="Car">Car</option>
      </select>
    </div>

    <div class="form-group">
      <label>Notes:</label>
      <textarea class="form-control" placeholder="please enter words less than 20 words" [(ngModel)]="trip.notes" name="notes" rows="3"></textarea>
    </div>

    <button type="submit" class="btn btn-success mt-3">
      {{ isEditMode ? 'Update Trip' : 'Add Trip' }}
    </button>
  </form>
</div>
